    root: {
      borderBottom: '1px solid rgba(0, 0, 0, .125)',
      backgroundColor: 'rgb(38, 37, 37',
      color: '#444444',
      boxShadow: 'none',
      '&:not(:last-child)': {
        borderBottom: 0,
      },
      '&:before': {
        display: 'none',
      },
      '&$expanded': {
        margin: 'auto',
      },
    },
    expanded: {},
  })(MuiAccordion);

  const AccordionSummary = withStyles({
    root: {
      backgroundColor: 'rgba(0,0,0,0)',
      color: '#444444',
    //   boxShadow: '0 2px 8px 0 rgb(201, 201, 201)',
    //   borderBottom: '1px solid rgba(0, 0, 0, 0)',
      marginBottom: -1,
      minHeight: 56,
      '&$expanded': {
        minHeight: 56,
      },
    },
    content: {
      '&$expanded': {
        margin: '12px 0',
      },
    },
    expanded: {},
  })(MuiAccordionSummary);

  const AccordionDetails = withStyles((theme) => ({
    root: {
      padding: theme.spacing(2),
      backgroundColor: 'rgb(240, 240, 240)',
